import { ChatContextProvider } from "./context/ChatContext";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
 < AuthContextProvider>
 ChatContextProvider
  <React.StrictMode>
    <App />
  </React.StrictMode>
  </AuthContextProvider>
);
